/* font-icon */
@font-face {
    font-family: 'Smartisan';
    font-style: normal;
    font-weight: 900;
    src: url('62eada6797ba80e277ca459cc4e6cd13.woff') format('woff');
}

@font-face {
    font-family: 'Material Icons';
    font-style: normal;
    font-weight: 400;
    src: url('5d8dd6ffdf8e343511f04d2c51f01809.woff2') format('woff2');
}

.material-icons {
    font-family: 'Material Icons';
    font-weight: normal;
    font-style: normal;
    font-size: 24px;
    line-height: 1;
    letter-spacing: normal;
    text-transform: none;
    display: inline-block;
    white-space: nowrap;
    word-wrap: normal;
    direction: ltr;
    -webkit-font-feature-settings: 'liga';
    -webkit-font-smoothing: antialiased;
}

/* main */
html, body {
    width: 100%;
    height: 100%;
}

.form-wrapper {
    height: 100%;
    margin: 0;
    display: flex;
    justify-content: center;
    align-items: center;
    align-content: center;
}

.form-wrapper .form {
    margin-left: 0 !important;
}

.form-wrapper .card-image {
    margin-bottom: 50px;
}

.form-wrapper .img {
    max-width: 100%;
    height: auto;
    cursor: pointer;
}

.form-wrapper .update-btn {
    width: 50px;
    overflow: hidden;
    padding: 0;
}

.form-wrapper .file-path.valid {
    box-shadow: 1px 1px 0 0 #4CAF50 !important;
}

.form-wrapper .download {
    width: 100%;
    margin: 10px auto;
    display: flex;
    align-items: center;
    align-content: center;
    justify-content: center;
}

.form-wrapper .download[disabled] {
    color: #FFFFFF !important;
    background-color: rgba(38, 166, 154, .5) !important;
}

.form-wrapper .file-icon-wrapper {
    display: flex;
    justify-content: center;
    align-items: center;
    align-content: center;
    height: 100%;
}

.form-wrapper .preloader-wrapper {
    width: 20px;
    height: 20px;
    display: none;
}

.form-wrapper .spinner-layer {
    border-color: #FFFFFF;
}

#toast-container {
    top: 62%;
    left: inherit;
    right: 50%;
    transform: translateX(50%);
    min-width: inherit;
}

#toast-container .toast {
    background-color: #ff9e80;
    font-size: 12px;
    min-height: inherit;
    padding: 5px 15px;
    white-space: nowrap;
}
